import React, {Component} from 'react'
import './band.css'
import data from './metal.json';

function Band() {

    var bands = data.map(function (data) {
        return data.band_name + data.fans + data.formed + data.origin;
    });

    console.log(bands)

    return (
        <div> 
            <h2>{data[0].band_name}</h2>
            <p>Formed: {data[0].formed} | Country: {data[0].origin} | Fans: {data[0].fans}</p>
        </div>
      )
}

export default Band
